import { BrowserRouter } from 'react-router-dom';
import './App.css';
import Test from './component/Test';

function App() {
  return (
    <BrowserRouter>
      <div>
        <Routes>
          <Route path='/' element={<Test/>} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
